export type Icons = keyof typeof icons;
interface IconProps {
  size?: number;
  name: Icons;
  className?: string;
  fill?: string;
}
export const Icon = ({ size, className, name, fill }: IconProps) => {
  const id = useId();

  return (
    <svg
      className={cn(className)}
      width={size}
      height={size}
      viewBox="0 0 16 16"
      fill={fill}
      strokeWidth="2"
      strokeMiterlimit="10"
      strokeLinecap="round"
      strokeLinejoin="round"
    >
      {typeof icons[name] === 'string' ? (
        <path d={icons[name] as string} />
      ) : (
        Array.from(icons[name] as string[], (d, index) => (
          <path d={d} key={`${name}-${id}-${index}`} />
        ))
      )}
    </svg>
  );
};
Icon.defaultProps = {
  size: 16,
  className: '',
  fill: undefined,
};
